// Help.js
import React from 'react';

const Help = ({ onClose }) => {
  return (
    <div className="help-container">
      <h2>How to Play Tylin Popper</h2>
      <p>Welcome to Tylin Popper! Your goal is to pop all the Tylins that appear on the screen.</p>
      <p>Here's how to play:</p>
      <ul>
        <li>Click on a Tylin to pop it and earn points.</li>
        <li>Be careful not to click on bushes or empty spaces, as it will result in a penalty.</li>
        <li>Your overall score is calculated based on points earned, time taken, and penalties incurred.</li>
        <li>Try to achieve the highest overall score!</li>
      </ul>
      <button onClick={onClose}>Close</button>
    </div>
  );
};

export default Help;
